import React, { useState, useEffect, createRef } from "react";
import "../App.css"


export default function ManageZip() {
	const [editWindow, setEditState] =useState(false)
	const buttonClick = (event) =>{
		setEditState(true)

	}


	if (!editWindow){return(
	<button onClick={buttonClick}>Add/edit saved zip</button>
	)}

	else{return <div className="edit-window"></div>}

}
